    Item Name Directory provides item name data for the development and maintenance
    of item identifications within the Federal Catalog System.  The tool provides 4
    options to search the H6 directory: Keyword, Federal Supply Class (FSC), Federal
    Item Identification Guide (FIIG), and Item Name Code (INC).  The result data is
